import React from 'react'
import ListProducts from "."



const CardsProducts = () => {
  return (
    <div>
       {ListProducts.map((product, i)=>(
      <div key={i}>
         <img src={(product.img)} alt="" />
      </div>
       ))}
    </div>
  )
}

export default CardsProducts
